import React, { useState } from "react";
import classes from "./StaffSalary.module.css";
import ChartStaff from "../charts/ChartStaff";
import Selector from "../Selectors/Selector";
import InformationSalary from "../Informations/InformationSalary";
import InformationExchange from "../Informations/InformationExchange";

export default function StaffSalary() {
  const [staffData, setStaffData] = useState({});
  const setData = async () => {
    const data = await API.getStaffSalaryData();
    if (data) {
      setStaffData(data);
    }
  };
  useEffect(() => {
    setData();
  }, []);
  // let staffData = [
  //   {
  //     name: "OB1CHAM",
  //     rank: "Модератор",
  //     mainSalary: 150,
  //     answerForum: 3,
  //     online: "21:00:00",
  //     additionallyOnline: "13:55",
  //     bonus: 200,
  //     totalWeek: 501,
  //     totalAllTime: 10,
  //     birthday: "3 сентября",
  //   },
  //   {
  //     name: "Rezorax",
  //     rank: "Помощник",
  //     mainSalary: 150,
  //     answerForum: 3,
  //     online: "21:00:00",
  //     additionallyOnline: "13:55",
  //     bonus: 200,
  //     totalWeek: 230,
  //     totalAllTime: 10,
  //     birthday: "3 сентября",
  //   },
  //   {
  //     name: "maxim332",
  //     rank: "Стажёр",
  //     mainSalary: 150,
  //     answerForum: 3,
  //     online: "21:00:00",
  //     additionallyOnline: "13:55",
  //     bonus: 200,
  //     totalWeek: 455,
  //     totalAllTime: 10,
  //     birthday: "3 сентября",
  //   },
  //   {
  //     name: "niki22ki",
  //     rank: "Стажёр",
  //     mainSalary: 150,
  //     answerForum: 3,
  //     online: "21:00:00",
  //     additionallyOnline: "13:55",
  //     bonus: 200,
  //     totalWeek: 460,
  //     totalAllTime: 10,
  //     birthday: "3 сентября",
  //   },
  // ];
  const options = [
    { value: "dt", label: "DraconicTech" },
    { value: "tmrpg", label: "TechnoMagicRPG" },
  ];
  // let chartData = {
  //   labels: [],
  //   playerData: [],
  // };
  // let salaryData = {
  //   mainSalary: 0,
  //   answerForum: 15,
  //   online: "105:00:00",
  //   additionallyOnline: "68:05:00",
  //   bonus: 1000,
  //   totalWeek: 1840,
  //   totalAllTime: 50,
  // };
  return (
    <div>
      <Selector
        className={classes.main}
        options={options}
        defaultValue={options[0]}
        isSearchable={false}
        onChange={({ value }) => {
          console.log(value);
        }}
      />
      <table className={classes.staffSalaryTable} id="history">
        <thead>
          <tr>
            <td>Никнейм модератора</td>
            <td>Должность на сервере</td>
            <td>Основная зарплата</td>
            <td>Ответы на форуме</td>
            <td>Отыгранный онлайн</td>
            <td>Дополнительный онлайн</td>
            <td>Дополнительный бонус</td>
            <td>Итог за неделю</td>
            <td>Общий итог</td>
            <td>День рождения</td>
          </tr>
        </thead>
        <tbody>
          {staffData["salaryPlayers"].map((player) => {
            // chartData["labels"].push(player["name"]);
            // chartData["playerData"].push(player["totalWeek"]);
            let colorRank = classes.player;
            if (player["rank"] === "Модератор") {
              colorRank = classes.moderator;
            } else if (player["rank"] === "Помощник") {
              colorRank = classes.helper2;
            } else {
              colorRank = classes.helper1;
            }
            return (
              <tr key={player["name"]}>
                <td>{player["name"]}</td>
                <td className={colorRank}>{player["rank"]}</td>
                <td>{player["mainSalary"]}</td>
                <td>{player["answerForum"]}</td>
                <td>{player["online"]}</td>
                <td>{player["additionallyOnline"]}</td>
                <td>{player["bonus"]}</td>
                <td>{player["totalWeek"]}</td>
                <td>{player["totalAllTime"]}</td>
                <td>{player["birthday"]}</td>
              </tr>
            );
          })}
        </tbody>
        <tfoot>
          <tr>
            <td>Итог</td>
            <td>-</td>
            <td>{salaryData["mainSalary"]}</td>
            <td>{salaryData["answerForum"]}</td>
            <td>{salaryData["online"]}</td>
            <td>{salaryData["additionallyOnline"]}</td>
            <td>{salaryData["bonus"]}</td>
            <td>{salaryData["totalWeek"]}</td>
            <td>{salaryData["totalAllTime"]}</td>
            <td>-</td>
          </tr>
        </tfoot>
      </table>
      <div className={classes.information}>
        <InformationSalary value={2179} />
        <InformationExchange />
      </div>
      <ChartStaff data={staffData["charData"]} />
    </div>
  );
}
